<?php

/**
  * Template functions
  */
function helsinki_svg_logo( string $size = '' ) {
	echo helsinki_get_svg_logo($size);
}

function helsinki_get_svg_logo( string $size = '' ) {
	$language = function_exists('pll_current_language') ? pll_current_language('slug') : '';
	$language = $language === 'sv' ? 'sv' : 'default';

	$path = helsinki_svg_logo_paths($language);

	$classes = array(
		'logo-icon',
		'logo-icon--' . $language,
	);

	if ( $size ) {
		$classes[] = $size;
	}

	return sprintf(
		'<svg class="%s" viewBox="%s" aria-hidden="true">
			<path d="%s"></path>
		</svg>',
		esc_attr(implode(' ', $classes)),
		helsinki_svg_view_box( 'logo_' . $language ),
		$path
	);
}

function helsinki_svg_placeholder( string $key ) {
	echo helsinki_get_svg_placeholder( $key );
}

function helsinki_get_svg_placeholder( string $key ) {
	$path = helsinki_placeholder_svg_paths( $key );
	return $path ? sprintf(
		'<svg class="icon icon--%s" viewBox="%s" aria-hidden="true" tabindex="-1">
			<g id="%s" stroke="none" stroke-width="1" fill-rule="evenodd">
				<path d="%s" fill-rule="nonzero"></path>
			</g>
		</svg>',
		$key,
		helsinki_svg_view_box('abstract'),
		$key,
		$path
	) : '';
}

function helsinki_svg_icon( string $key ) {
	echo helsinki_get_svg_icon($key);
}

function helsinki_get_svg_icon( string $key, string $extra_classes = '' ) {
	$path = helsinki_svg_paths( $key );
	return $path ? sprintf(
		'<svg class="icon icon--%s %s" viewBox="%s" aria-hidden="true" tabindex="-1">
			<path d="%s"></path>
		</svg>',
		$key,
		$extra_classes,
		helsinki_svg_view_box($key),
		$path
	) : '';
}

/**
  * Sizing
  */
function helsinki_svg_view_box( string $key = '' ) {
	switch ( $key ) {
		case 'abstract':
			return '0 0 182 182';
			break;

		case 'logo_default':
			return '0 0 78 36';
			break;

		case 'logo_sv':
			return '0 0 104 36';
			break;

		default:
			return '0 0 24 24';
			break;
	}
}

